vector<vector<int>> threeNumberSum(vector<int> array, int targetSum) {
	// Write your code here.

	vector<int> array2 = array;
	vector<vector<int>> returnArray = {};

	std::sort(array2.begin(), array2.end());

	int length = array2.size();

	for (int i = 0; i < length - 1; i++) {

		cout << array2[i] << " ";


		int left = i + 1;
		int right = length - 1;

		while (left < right) {
			if (array2[i] + array2[left] + array2[right] > targetSum) {
				right--;
			}
			else if (array2[i] + array2[left] + array2[right] < targetSum)
			{
				left++;
			}
			else if (array2[i] + array2[left] + array2[right] == targetSum) {
				vector<int> t;
				t.push_back(array2[i]);
				t.push_back(array2[left]);
				t.push_back(array2[right]);
				returnArray.push_back(t);

				right--;
				left++;
			}
		}

	}
	return returnArray;
}

int countLongest(string a, string b, int length) {

	int * c = new int[length*length];

	for (int i = 0; i < length*length; i++) {
		c[i] = 0;
	}

	for (int i = 0; i < length; i++)
	{
		if (i % 40 == 9) {
			printf("i: %d\n", i);
		}
		for (int j = 0; j < length; j++)
		{
			if (b[j] == a[i]) {
				if (j == 0 || i == 0) {
					c[j + i * length] = 1;
				}
				else
				{
					c[j + i * length] = c[j - 1 + (i - 1) * length] + 1;
				}
			}
			if (b[j] != a[i]) {
				int toLeft = 0;
				if (j != 0) {
					//toLeft = c[i * length + j - 1];
				}

				int toNorth = 0;
				if (i != 0) {
					//toNorth = c[(i - 1) * length + j];
				}
				if (toLeft > toNorth) {
					c[i * length + j] = toLeft;
				}
				else
				{
					c[i * length + j] = toNorth;
				}
			}
		}
	}

	int longestCount = 0;
	for (int i = 0; i < length; i++) {
		for (int j = 0; j < length; j++) {
			if (longestCount < c[i*length + j]) {
				longestCount = c[i*length + j];
			}
		}
	}
	return  longestCount;
}

int count(string a, string b) {
	return  countLongest(a, b, a.length());
}

